import React, { Suspense, useEffect, useState } from "react";
import { Box } from "@mui/material";

import { useParams } from "react-router-dom";
import ResponsiveLayout from "../../ResponsiveLayout/ResponsiveLayout";
import { TestChartContainer } from "./TestChartContainer";

const layoutInitialTwo = [
  { w: 4, h: 2, x: 0, y: 0, i: "a", static: false },
  { w: 8, h: 4, x: 0, y: 0, i: "e", static: false },
  { w: 4, h: 2, x: 0, y: 0, i: "b", static: false },
  { w: 4, h: 4, x: 0, y: 0, i: "c", static: false },
  { w: 4, h: 4, x: 0, y: 0, i: "d", static: false },
];

const PageLayoute = () => {
  const [currentPage, setCurrentPage] = useState();
  const [layout, setLayout] = useState(layoutInitialTwo);
  const { page, sub, group } = useParams();

  useEffect(() => {
    if (group) {
      setCurrentPage(group);
      return;
    }
    if (sub) {
      setCurrentPage(sub);
      return;
    }
    if (page) {
      setCurrentPage(page);
      return;
    }
  }, [page, sub, group]);

  return (
    <Box sx={{ width: "100%" }}>
      <h1>{currentPage}</h1>
      <Box
        sx={{
          position: "relative",
          backgroundColor: "#eef2f6",
          boxShadow: "inset 0 0 10px 0px rgba(0,0,0,0.3)",
          borderRadius: "12px",
          borderBottomLeftRadius: "0",
          borderBottomRightRadius: "0",
        }}
      >
        <ResponsiveLayout layout={layout} setLayout={setLayout}>
          {layout.map((elem) => (
            <Box key={elem.i}>
              <TestChartContainer />
            </Box>
          ))}
        </ResponsiveLayout>
        <Box
          sx={{
            height: "100%",
            width: "1px",
            boxShadow: "0 0 10px 0 rgba(0,0,0,0.3)",
            backgroundColor: "#eef2f6",
            position: "absolute",
            right: "-20px",
            top: "-20px",
          }}
        />
      </Box>
    </Box>
  );
};

export default PageLayoute;
